  false,\n\t\"url\": null,\n\t\"notes\": \"Preliminary study draft, with maps, of
  seven gold rush trails in Alaska, to determine suitability for inclusion in the
  National Scenic Trails system and their potential for further in-depth study. The
  trails described are Seward-Nome route (Iditarod Trail), the Valdez-Fairbanks Trail,
  the Chilkoot Trail, the White Pass Trail, the Dalton Trail, the Valdez-Eagle Trail
  and the Telegraph Route (Washington-Alaska Military Cable and Telegraph System),
  and the Wiseman Trail (Koyukuk-Chandalar routes).\",\n\t\"license_title\": \"License
